attr_text {

    Name = .MAIN,
    VA= MAIN_BASE_TEXT_VA ,
    RA= MAIN_BASE_TEXT_RA ,
    PA= ra2pa2(MAIN_BASE_TEXT_RA ,tid2pid(i)),
    [part_]tid2pid(i)[_ctx_nonzero]_tsb_config_0,
